import React from "react";
import logo from "./logo.svg";
import "./App.css";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import CounterApp from "./components/counterapp"

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Switch>
          <h1>Counter App</h1>
          <CounterApp />
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
